import React from 'react';
import './WorkExperience.css';

const Projects = () => {
  return (
<section className="work-experience-section">
      <h2 className="section-title">Work Experience</h2>

      <div className="timeline">
        <div className="job">
          <div className="job-header">
            <h3>Job Title</h3>
            <p className="company-info">Company Name - Location</p>
            <p className="duration">Duration: Start Date - End Date</p>
          </div>
          <ul>
            <li>Responsibility 1</li>
            <li>Responsibility 2</li>
            {/* Add more responsibilities as needed */}
          </ul>
        </div>

        <div className="job">
          <div className="job-header">
            <h3>Another Job Title</h3>
            <p className="company-info">Another Company Name - Location</p>
            <p className="duration">Duration: Start Date - End Date</p>
          </div>
          <ul>
            <li>Responsibility 1</li>
            <li>Responsibility 2</li>
            {/* Add more responsibilities as needed */}
          </ul>
        </div>

        {/* Add more job experiences as needed */}
      </div>
    </section>
  );
};

export default Projects;
